import os

def show_thumbnails(thumbnail_dir):
    thumbnails = []
    for f in os.listdir(thumbnail_dir):
        if f.endswith('.jpg'):
            thumbnails.append(f)

    return thumbnails

def create_thumbnail(thumbnail_dir, image_path):
    status = {'created': False, 'error_msg': ''}

    try:
        image_cmd = f'identify "{image_path}"'
        os.system(image_cmd)

        thumb_cmd = f'convert "{image_path}" -resize "50x50" "{thumbnail_dir}/thumbnail.jpg"'
        os.system(thumb_cmd)

        status['created'] = True
    except Exception as e:
        status['error_msg'] = str(e)

    return status

def main():
    image_dir = 'files/images'
    thumbnail_dir = 'files/thumbnails'

    for f in os.listdir(image_dir):
        if f.endswith('.jpg'):
            image_path = os.path.join(image_dir, f)
            thumb_status = create_thumbnail(thumbnail_dir, image_path)

            if thumb_status['created']:
                print(f'Thumbnail created for {f}')
            else:
                print(f'Could not create thumbnail for {f}: {thumb_status["error_msg"]}')

    thumbnails = show_thumbnails

