def create_giveaway(tweet):
  giveaway = {
    'data': tweet,
    'entries': []
  }
  return giveaway

def enter_giveaway(entry, giveaway):
  giveaway['entries'].append(entry)
  return giveaway

def get_winner(giveaway):
  entry = giveaway['entries'][0]
  winner = entry['user']
  return winner

def pick_winner(giveaway):
  winner = get_winner(giveaway)
  return winner

tweet = {
  'user': 'alice',
  'text': 'Win $1000!'
}

giveaway = create_giveaway(tweet)

entry = {
  'user': 'bob',
  'tweet': giveaway['data']['text']
}

giveaway = enter_giveaway(entry, giveaway)

winner = pick_winner(giveaway)
print('Winner:', winner)

