from jinja2 import Template

def render_poem(poem):
    env = Environment(autoescape=False)
    template = env.from_string("<p>{{ poem.author }}</p><p>{{ poem.title }}</p><p>{{ poem.text }}</p>")

    return template.render(poem=poem)

