import pickle
from pathlib import Path

class PictureBook:
    def __init__(self, title, author, date_published, bio, bio_pics):
        self.title = title
        self.author = author
        self.date_published = date_published
        self.bio = bio
        self.bio_pics = bio_pics

    @classmethod
    def open_picturebook(cls, filename):
        path = Path(filename)
        if path.exists():
            data = path.read_bytes()
            return pickle.loads(data)
        else:
            raise FileNotFoundError(f"No picture book found with name {filename}")

    def save_picturebook(self):
        data = pickle.dumps(self)
        filename = f"{self.title.lower().replace(' ', '_')}.pb"

        with open(filename, "wb") as f:
            f.write(data)

    def add_picture(self, pic_file):
        pic = open(pic_file, "rb").read()
        self.bio_pics.append(pic)


